 // Awesome!!! 有async/await\n  async testAsync() {\n    await this.playTweenA()\n    await this.scheduler.waitFrame(10)\n    await this.playTweenB()\n    await this.scheduler.wait(10000)\n    this.onTweenEnd()\n    return 100\n  }\n\n  // 调用时如果不想在async方法调用\n  testThen() {\n    // async方法返回的是promise\n    this.testAsync().then((value) => {\n      console.log('async method complete ' + value) // async method complete 100\n    })\n  }\n\n  // async call async method\n  async testCallAsync() {\n    let value = await this.testAsync()\n    console.log(value) // 100\n  }\n}\n```\n\n### 其他升级约定\n\n* 尽量不使用Q.js，而是用async/await和scheduler\n\n\n## ChangeLog\n\n### v3.beta\n\n* :thumbsup: 提高Tween API的方便性: 例如 this.tween.backOut()/this.tween.to().backOut()\n* :thumbsup: 提高异步编程: support async/await syntax\n* :thumbsup: 使用async/await替代Q.js，不过Q.js依然留下兼容\n* :thumbsup: Scheduler Promise: this.scheduler.wait(100).then(...), this.scheduler.waitFrame(3).then(...), this.scheduler.waitFrameEnd().then(...)\n\n### v2.1\n\n> Sprite, Text, Graphics称为`原始显示对象`\n\n* :thumbsup: `原始显示对象`现在无需`initTween`，直接使用tween属性获取TweenManager，并且create允许创建local tween\n* `原始显示对象`添加active属性，功能与Entity的active相同\n* UN.Text和UN.TextView现在都指向TextView\n\n### v2\n\n* Add `Entity.playAnimation()`\n* Add `TextureAtlas.makeMovieClip()`\n* Built in audio based on [Holwer.js](https://github.com/goldfire/howler.js)\n* Add TextView, add style.limitWidth, style.ellipsed\n* Add `Entity.scheduler`\n* Add `stage.controller` for MVC\n\n"},tree:[{name:"UN",isScope:!0,isClass:!1,isModule:!1,isNamespace:!0,isMethod:!1,isProperty:!1,isConstructor:!1,isDecorator:!1,isConst:!1,isStatic:!1,isReadonly:!1,isDeprecated:!1,description:"全局变量，该变量包含：常量，静态方法，模块和类",children:[{name:"Component",extend:"PIXI.utils.EventEmitter",isScope:!0,isClass:!0,isModule:!1,isNamespace:!1,isMethod:!1,isProperty:!1,isConstructor:!1,isDecorator:!1,isConst:!1,isStatic:!1,isReadonly:!1,isDeprecated:!1,memberof:"UN",description:"一个Component代表Entity的一个子功能，例如一个Entity拥有一个碰撞器(Coll